import React from 'react';
import Github from './icons/Github';
import Twitter from './icons/Twitter';
import LinkedIn from './icons/LinkedIn';
import DevTo from './icons/DevTo';

const data = {
  "social": [
    {
      "name": "github",
      "link": "https://github.com/egiurleo",
      "svg": <Github />
    },
    {
      "name": "twitter",
      "link": "https://twitter.com/EmilyGiurleo",
      "svg": <Twitter />
    },
    {
      "name": "dev.to",
      "link": "https://dev.to/egiurleo",
      "svg": <DevTo />
    },
    {
      "name": "linkedin",
      "link": "https://linkedin.com/in/egiurleo",
        "svg": <LinkedIn />
    },
  ],
  "about": "I'm a software engineer at MongoDB working on the <a href=\"https://github.com/mongodb/mongo-ruby-driver\">Ruby driver</a> and Mongoid ODM. I have previously worked at Codecademy. I care a lot about accessible education, civic engagement, and cats."
}

export default data;
